import types from "./../types/typeOfActions";
const initialState = [];
const productReducers = (state = initialState, action) => {
  switch (action.type) {
    case types.GET_ALL_PRODUCTS:
      let { payload } = action;
      state = [...payload];
      return [...state];
    case types.
    default:
      return [...state];
  }
};
export default productReducers;
